(134, 1525135000, 6, 0, 'json', 'news', 'https://newsapi.org/v2/top-headlines?country=us&apiKey=7fd4557f70a8405f915727e09dcd9747', '', '{\"status\":\"ok\",\"totalResults\":20,\"articles\":[{\"source\":{\"id\":\"the-new-york-times\",\"name\":\"The New York Times\"},\"author\":\"https://www.nytimes.com/by/sheera-frenkel, https://www.nytimes.com/by/cade-metz\",\"title\":\"WhatsApp Co-Founder Leaving Facebook Amid User Data Disputes\",\"description\":\"Jan Koums exit is the highest-profile departure from Facebook after months of controversy at the social network. A company executive said security of user data was behind Mr. Koums decision.\",\"url\":\"https://www.nytimes.com/2018/04/30/technology/whatsapp-facebook-jan-koum.html\",\"urlToImage\":\"https://static01.nyt.com/images/2018/05/01/business/01WHATSAPP-print/01WHATSAPP02-facebookJumbo.jpg\",\"publishedAt\":\"2018-05-01T00:11:00Z\"},{\"source\":{\"id\":null,\"name\":\"Latimes.com\"},\"author\":\"Michael Finnegan\",\"title\":\"Stormy Daniels sues Trump for defamation over \'con job\' remark on Twitter\",\"description\":\"Porn actress Stormy Daniels has sued President Trump for defamation over a tweet that mocked her for saying a man once threatened her on Trump\'s behalf.\",\"url\":\"http://www.latimes.com/politics/la-na-pol-stormy-daniels-defamation-trump-20180430-story.html\",\"urlToImage\":\"http://www.latimes.com/resizer/4XRXN8AyIVu98eyFB6_eZDYc_zA=/1200x0/arc-anglerfish-arc2-prod-tronc.s3.amazonaws.com/public/2622DZJAGNHPLOQGOW4ETGDHHM.jpg\",\"publishedAt\":\"2018-04-30T23:37:30Z\"},{\"source\":{\"id\":\"abc-news\",\"name\":\"ABC News\"},\"author\":\"ABC News\",\"title\":\"EXCLUSIVE: EPA whistleblower says Pruitt \'lied\' to Congress\",\"description\":\"A whistleblower from the Environmental Protection Agency says that Administrator Scott Pruitt was \\\"bold-faced\\\" lying when he said he did not retaliate against employees.\",\"url\":\"http://abcnews.go.com/Politics/exclusive-epa-whistleblower-pruitt-bald-fac