t\",\"title\":\"Wildfire in Arizona grows to 13.5 square miles, burns buildings in its path\",\"description\":\"Residents of about 10 communities in the mountains about 100 miles northeast of Phoenix were evacuated Sunday after winds gusted to more than 50 mph in the area, fanning a fire that started Friday.\",\"url\":\"https://www.usatoday.com/story/news/nation-now/2018/04/30/tinder-fire-arizona/564177002/\",\"urlToImage\":\"https://www.gannett-cdn.com/-mm-/ddb5c87eb9eabe6414c8d174a195ee6adedf3959/c=0-324-1998-1453&r=x1683&c=3200x1680/local/-/media/2018/04/30/USATODAY/USATODAY/636606811144782089-tinder-fire-043018.jpg\",\"publishedAt\":\"2018-04-30T17:44:37Z\"},{\"source\":{\"id\":null,\"name\":\"Wtop.com\"},\"author\":\"Neal Augenstein\",\"title\":\"Pool worker who tried to drown himself sues police who resuscitated him\",\"description\":\"A pool worker who almost drowned himself in a Fairfax apartment complex pool has filed a federal lawsuit against county police officers and a pool company.\",\"url\":\"https://wtop.com/fairfax-county/2018/04/pool-worker-tried-drown-sues-police-resuscitated/\",\"urlToImage\":\"https://wtop.com/wp-content/uploads/2018/04/drownpic.jpg\",\"publishedAt\":\"2018-04-30T13:35:49Z\"}]}', 0, 0, '', '', ''),
